import React from 'react';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import ScrollToTop from './components/ScrollToTop';
import PrivateRoute from './components/PrivateRoute';
import Layout from './components/Layout';
import { useAuth } from './contexts/AuthContext';

// Page imports
import Home from './pages/Home';
import Buy from './pages/Buy';
import Rent from './pages/Rent';
import Sell from './pages/Sell';
import Properties from './pages/Properties';
import NotFound from './pages/NotFound';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Dashboard from './pages/Dashboard';
import CreateAd from './pages/CreateAd';
import AuthRequiredModal from './components/AuthRequiredModal';

// Auth check component that renders either the component or the auth modal
const AuthCheck = ({ children }) => {
  const { currentUser } = useAuth();

  if (!currentUser) {
    return (
      <div className="relative">
        {/* Render the children with a semi-transparent overlay */}
        <div className="pointer-events-none opacity-50">
          {children}
        </div>
        {/* Show the auth modal on top */}
        <AuthRequiredModal />
      </div>
    );
  }

  return children;
};

function App() {
  return (
    <>
      <ScrollToTop />
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Layout hideNavbar={true}><Home /></Layout>} />
        <Route path="/properties" element={<Layout hideNavbar={true}><Properties /></Layout>} />
        <Route path="/login" element={<Layout hideNavbar={true}><Login /></Layout>} />
        <Route path="/signup" element={<Layout hideNavbar={true}><Signup /></Layout>} />
        
        {/* Routes that require authentication */}
        <Route 
          path="/buy" 
          element={
            <AuthCheck>
              <Layout hideNavbar={true}><Buy /></Layout>
            </AuthCheck>
          } 
        />
        <Route 
          path="/rent" 
          element={
            <AuthCheck>
              <Layout hideNavbar={true}><Rent /></Layout>
            </AuthCheck>
          } 
        />
        <Route 
          path="/sell" 
          element={
            <AuthCheck>
              <Layout hideNavbar={true}><Sell /></Layout>
            </AuthCheck>
          } 
        />
        
        {/* Protected routes */}
        <Route 
          path="/dashboard" 
          element={
            <PrivateRoute>
              <Layout hideNavbar={true}>
                <Dashboard />
              </Layout>
            </PrivateRoute>
          } 
        />
        <Route 
          path="/create-ad" 
          element={
            <PrivateRoute>
              <Layout hideNavbar={true}>
                <CreateAd />
              </Layout>
            </PrivateRoute>
          } 
        />
        
        {/* Fallback route */}
        <Route path="*" element={<Layout hideNavbar={true}><NotFound /></Layout>} />
      </Routes>
    </>
  );
}

export default App;
